import React, { Component } from 'react';
import Nav from 'pages/Nav';
import './Assignment.css'

class Assignment extends Component {
    render () {
        return (
            <div>
                <Nav />
                <div className="Submit">
                    <h2>과제제출</h2>
                    <select>
                        <option value="">과목선택</option>
                    </select>
                </div>
            </div>
        )
    }
}

export default Assignment;
